import React from 'react';
import Story from '../story/story.component';

export const StoryList = ({ stories }) => {
    return (
        <div className='story-list'>
            {
                stories.map(story => {
                    const { id } = story;
                    return <Story key={id} story={story} />
                })
            }
        </div>
    )
}

export default StoryList;
